// store/user.js
import AuthService from '@/services/AuthService'; // Assuming AuthService is imported and available

export default {
    state: {
        user: null, // Initial user state
        isLoggedIn: false, // Tracks the login status
    },
    mutations: {
        setUser(state, user) {
            state.user = user;
            state.isLoggedIn = !!user;
        },
        clearUser(state) {
            state.user = null;
            state.isLoggedIn = false;
        }
    },
    actions: {
        async loginUser({ commit }, credentials) {
            try {
                // Call AuthService to authenticate the user
                const resp = await AuthService.login(credentials);
                const token = resp.token;
                // Decode the token to extract user information
                const user = AuthService.decodeToken(token);

                // Upon successful authentication, commit the setUser mutation
                commit('setUser', user);

                // Optionally, store the token in local storage or a cookie for persistent login
                localStorage.setItem('token', token);

                console.log('User logged in:', user.email);
            } catch (error) {
                // Handle authentication errors
                console.error('Failed to log in:', error);
                throw error;
            }
        },
        logoutUser({ commit }) {
            // Remove the token from local storage
            localStorage.removeItem('token');

            // Commit the clearUser mutation to reset the user state
            commit('clearUser');
        },
        rehydrateAuthenticationState({ commit }) {
            const token = localStorage.getItem('token');
            if (token) {
                // Decode the token to get the user info
                const user = AuthService.decodeToken(token);
                // Update the Vuex state with the decoded user info
                commit('setUser', user);
            } else {
                // If no token is found, clear the user state
                commit('clearUser');
            }
        }
    },
    getters: {
        isLoggedIn: (state) => state.isLoggedIn,
        currentUser: (state) => state.user,
    }
};

// Import Axios for making HTTP requests
import axios from 'axios'

const API_URL = 'http://localhost:3000'; // Replace this with your backend API URL

const AuthService = {
  async login(credentials) {
    try {
      // const email = credentials.email
      // const password = credentials.password
      // Make a POST request to your backend API to authenticate the user
      const response = await axios.post(`${API_URL}/auth/login`, credentials, {
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded'
        }
      })

      // Check if the login was successful
      if (response.status === 200) {
        console.log("abcabc", response);
        return response.data; // Return the user data
      }else {
        console.log('test1')
        throw new Error('Login failed: Incorrect credentials');
      }
    } catch (error) {
      // Handle other errors (e.g., network error)
      console.error('cde cde Login failed:', error);
      throw error;
    }
  },
  decodeToken(token){
    try {
      if (typeof token !== 'string') {
        throw new Error('Token must be a string.');
      }
      // Split the token into its parts
      const parts = token.split('.');
      if (parts.length !== 3) {
        throw new Error('Invalid token format.');
      }
      // Decode the payload from base64

      const payloadJson = atob(parts[1]);
      // Parse the payload as JSON
      const payload = JSON.parse(payloadJson);
      return payload;
    } catch (error) {
      console.error('Error decoding token:', error);
      return null;
    }
  },
};

export default AuthService;
